import React from 'react'
import { View  , TouchableOpacity,StyleSheet,Text
} from 'react-native'


const CustomButton =() =>
{
    return(
        <TouchableOpacity >
            <View style={styles1.container}>
                 <Text>dd</Text>
            </View>
        </TouchableOpacity>
        
    )
};

export default CustomButton;

const styles1 = StyleSheet.create({
    container :{
        backgroundColor:'#0077b6',
        width:'30%',
        justifyContent:'center'

    }


})
